import Header from "../header/Header.js";
import Recipes from "../recipes/Recipes.js";
import recipeData from "../recipeData/Recipe-data.json";

export default function Randomizer({ recipeList }) {
  let testarray = [recipeList];
  console.log(recipeList);
  let random = testarray[Math.floor(Math.random() * testarray.length)];

  return (
    <>
      <Header title="Randomizer" />
      <h3> randomizer site </h3>
      <h3> {random} </h3>
    </>
  );
}
